Hi Frank,

Very clear EVP. I don&#39;t really think it&#39;s a matter of you getting bogus
EVP. I think some of what they are telling you is metaphors and if that
can be figured out it might be the key to understanding what they are
telling you. What do you think?

Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Sumption Frank
Sent: Monday, June 19, 2006 9:14 AM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Voice about Art Bell.

Hi All;
 I found this on the second listening of the June 5th tape, I don&#39;t know
how I missed the first time through. This is the stuff that confuses me
to no end, I get all this bogus prophecy crap, as if something wants to
discredit the boxes, then I get this kind of voice. I did put this on my
site.  http://franksumption.tripod.com/id144.html


 Frank


